function [ys_, params, info] = steadystate(ys_, exo_, params)
% Steady state generated by Dynare preprocessor
    info = 0;
    ys_(34)=params(16);
    ys_(27)=1;
    ys_(6)=1/params(1)+params(9)-1;
    ys_(7)=1/params(1);
    ys_(8)=1;
    ys_(17)=1;
    ys_(14)=(params(10)-1)/params(10);
    K_Y=ys_(14)*params(6)/ys_(6);
    I_Y=params(9)*K_Y;
    C_Y=1-params(21)-params(20)-I_Y-params(22);
    GK_Y=params(21)*1/params(9);
    ys_(12)=steady_helper(C_Y,params(20),K_Y,params(24),params(26),ys_(6),params(9),params(12),ys_(34),params(6),ys_(14),params(5),params(4),params(3));
    Cw_Y=(C_Y-ys_(14)*ys_(34)*(1-params(12))*(1-params(6))/ys_(12)-K_Y*params(26)*(1-params(12))*(ys_(6)-params(9))-params(24)*(1-params(12)))/params(12);
    ys_(23)=(ys_(12)*params(8)*(K_Y/ys_(12))^params(6)*GK_Y^params(7))^(1/(1-params(6)-params(7)));
    ys_(11)=K_Y*ys_(23);
    ys_(19)=I_Y*ys_(23);
    ys_(18)=C_Y*ys_(23);
    ys_(1)=Cw_Y*ys_(23);
    ys_(22)=params(21)*ys_(23);
    ys_(13)=GK_Y*ys_(23);
    ys_(33)=params(24)*ys_(23);
    ys_(30)=params(22)*ys_(23);
    ys_(31)=1/params(9)*ys_(30);
    ys_(4)=ys_(23)*ys_(14)*(1-params(6))/ys_(12);
    ys_(29)=params(26)*ys_(11);
    ys_(10)=ys_(33)+ys_(34)*ys_(4)+(ys_(6)-params(9))*ys_(29);
    ys_(20)=ys_(23)*params(23);
    ys_(24)=params(20)*ys_(23);
    ys_(21)=ys_(33)+ys_(30)+ys_(22)+ys_(24)+ys_(34)*(1-params(12))*ys_(4)-ys_(20)*(1-ys_(7));
    ys_(9)=ys_(21)/params(12);
    ys_(5)=ys_(12)/params(12);
    ys_(2)=(ys_(11)-(1-params(12))*ys_(29))/params(12);
    ys_(26)=(ys_(19)-ys_(29)*params(9)*(1-params(12)))/params(12);
    ys_(3)=ys_(20)/params(12);
    ys_(25)=ys_(5)^params(3)/ys_(4);
    ys_(15)=ys_(23)*ys_(14)*ys_(25)/(1-params(1)*params(11));
    ys_(16)=ys_(23)*ys_(25)/(1-params(1)*params(11));
    ys_(28)=0;
    ys_(32)=ys_(31)/ys_(23);
